 game_concept_communication_efficiency:0 "Communication Efficiency"
 game_concept_communication_efficiency_desc:0 "Communication Efficiency, is the time it takes to reach a province for a polity agent travelling from the capital. It represents how difficult it is for the central authority to exert control over far away provinces. Fast communication ensures that local [control|E] is high and improving communication efficiency is one of the best methods to increase [control|E] in the game.\n\nTravel time is dependent on terrain, roads, special buildings and, for travel across water, trade harbours."


