 game_concept_holding_desc:0 "A $game_concept_holding$ represents a [barony|E] or [county_capital|E].\n\nIt provides [taxes|E] and [levies|E] to its [holder|E], depending on its [holding_type|E]. The collection of Settlements personally controlled by a [ruler|E] is called a [domain|E]."
 game_concept_holding_type:0 "Settlement Control"
 game_concept_holding_types:0 "Settlement Control"
 game_concept_holding_type_desc:1 "There are three types of [holdings|E]; [castles|E], [cities|E] and [temples|E]. Each type allows different types of [buildings|E]."
 game_concept_castle_holding:0 "Noble Settlement"
 game_concept_castle:0 "Noble Settlement"
 game_concept_castles:0 "Noble Settlements"
 game_concept_castle_holdings:0 "Noble Settlements"
 game_concept_castle_holding_desc:0 "Noble Settlements are the most heavily fortified [holding_type|E] and the standard type for [feudal|E], [clan|E] and [tribal|E] [rulers|E], as well as [holy_orders|E]."
 game_concept_temple_holding:0 "Clerical Settlement"
 game_concept_temple:0 "Clerical Settlement"
 game_concept_temples:0 "Settlement"
 game_concept_temple_holdings:0 "Clerical Settlements"
 game_concept_temple_holding_desc:0 "Clerical Settlements are a type of [holding_type|E] that are controlled by members of the [clergy|E] as [church_property|E] (the [theocratic|E] [government_form|E]). However, in [faiths|E] with the [GetFaithDoctrine('doctrine_theocracy_lay_clergy').GetBaseName] [doctrine|E], anyone can hold Temples without penalty."
 game_concept_city_holding:0 "Commune Settlement"
 game_concept_city:0 "Commune"
 game_concept_cities:0 "Commune"
 game_concept_city_holdings:0 "Commune Settlements"
 game_concept_tribal_holding:0 "Tribal Settlement"
 game_concept_tribal_holding_desc:0 "Tribes are poor in [taxes|E] but rich in [levies|E], [prestige|E], and [men_at_arms|E] upgrades. They have limited upgrade potential and, while strong early, quickly dwindle in power the longer time progresses. Only [tribal|E] characters can hold them without penalties.\n\nIf a Tribe exists in a [county|E], no other [holdings|E] can be built. [feudal|E] rulers will have to spend [gold|E] to transform Tribes into [castles|E]."
 game_concept_tribe:0 "Tribal Settlement"
 game_concept_city_holding_desc:1 "Communes are [holding_type|E] controlled by a city council. They are associated with [republics|E]."

